import React, { useEffect, useState } from 'react'
import { Link, useParams } from 'react-router-dom'
import './clubbystudent.css';
import StudentHeading from '../../common/heading/studentheading/StudentHeading';

const ClubProfileStudent = () => {
    const urlString = 'http://localhost:3000/Sanskriti';
    const url = new URL(urlString);
    const name = url.pathname.split('/').filter(segment => segment)[0];
    console.log(name);

    const mysql = require("mysql");
    const [data, setData] = useState([]);
    useEffect(() => {
        const connection = mysql.createConnection({
            host: "localhost",
            user: "root",
            password: "root",
            database: "members"
        });

        connection.connect();

        connection.query(
            `SELECT club, domain, bio, name, srn 
            FROM club 
            JOIN head ON 
            club.clubid = head.clubid AND club.club='Sanskriti'`, (error, results) => {
                if (error) {
                    console.error(error);
                } else {
                    console.log(results);
                    setData(results);
                }
            });

        connection.end();
    }, []);

    return (

        <div>
            <StudentHeading />
            <div class='profile-banner'>
                <div class='profile-image'></div>
                <div class='profile-heading'>
                    <p class='profile-title-1'>{name}</p>

                    <p class='profile-club-domain'>Domain</p>
                </div>
            </div>
            <div class='profile-content'>
                <p class='title'><center>About Us</center></p>
                <p><center>Sanskriti is a vibrant fusion of tradition and expression, celebrating the rich heritage of Indian dance forms. Through rhythmic movements and storytelling, the club showcases the elegance of Bharatanatyam, the grace of Kathak, and the expressiveness of Odissi. Join us to immerse yourself in the artistry, delve into cultural narratives, and embark on a rhythmic journey that transcends time. Uniting enthusiasts, the club offers a platform to learn, appreciate, and perpetuate the captivating allure of Indian classical dance. Discover the beauty of tradition with a contemporary touch, fostering a community passionate about the cultural tapestry.</center></p>
                <div class='club-head'>
                    <p class='title'><center>Meet The Club Leads!</center></p>
                    <div className='profile-cards'>
                        <div className='profile-card-text'>
                            <section className='circular-card'></section>
                            {data.map((item) => 
                            <section><p class='club-head-name' key={item.id}>{item.head}</p></section>
                            )}
                            <section><p class='club-head-srn'>SRN</p></section>
                        </div>
                        <div className='profile-card-text'>
                            <section className='circular-card'></section>
                            <section><p class='club-head-name'>Club Head 2</p></section>
                            <section><p class='club-head-srn'>SRN</p></section>
                        </div>
                        <div className='profile-card-text'>
                            <section className='circular-card'></section>
                            <section><p class='club-head-name'>Club Head 3</p></section>
                            <section><p class='club-head-srn'>SRN</p></section>
                        </div>
                        <div className='profile-card-text'>
                            <section className='circular-card'></section>
                            <section><p class='club-head-name'>Club Head 4</p></section>
                            <section><p class='club-head-srn'>SRN</p></section>
                        </div>

                    </div>
                </div>
                <div class='events'>
                    <p class='title'><center>Upcoming Events</center></p>
                </div>

            </div>
            <section className='event-banner'></section>
            <div class='event-registration'>
                <div className='event-registration-left'>
                    <p class='profile-title-event'>Event Name</p>
                    <Link to='/'><button type='submit' class='register-button'>Register</button></Link>
                </div>
                <div className='event-registration-right'>
                    <p class='event-element'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Distinctio minima ipsa alias explicabo animi dolor quod consequuntur, illum eligendi nihil magni sunt quibusdam culpa neque quos ullam non quas itaque!</p>
                    <br></br>
                    <p class='event-element'>Date: xx/xx/xxxx</p>
                    <p class='event-element'>Timings: xx:xx - xx:xx</p>
                    <p class='event-element'>Venue: xx</p>
                    <br></br><br></br>
                </div>
            </div>
        </div>
    )
}

export default ClubProfileStudent
